var b="url",c="企业管理.html",d="generationDate",e=new Date(1605081798871.8),f="isCanvasEnabled",g=false,h="isAdaptiveEnabled",i="sketchKeys",j="",k="s0",l="variables",m="OnLoadVariable",n="LeftNavigationBarHide",o="page",p="packageId",q="7bfb49113544485b94fb56d8a60b89e9",r="type",s="Axure:Page",t="name",u="企业管理",v="notes",w="说明",x="<p><span>使用角色：总公司内勤、分公司内勤。</span></p><p><span>操作权限：</span></p><p><span>总公司内勤</span><span>：查询、新增、编辑、下载企业二维码、产品配置、内容配置、删除</span></p><p><span>分公司内勤</span><span>：查询、新增、编辑、下载企业二维码</span></p><p><span>数据权限：</span></p><p><span>总公司内勤：可见全部企业数据。</span></p><p><span>分公司内勤：自己机构负责的企业数据</span></p><p><span>页面说明：</span></p><p><span>1、页面支持按企业客户号或者企业名称模糊查询企业。</span></p><p><span>2、点击新增按钮跳转新增企业页面。</span></p><p><span>3、点击编辑按钮，跳转编辑企业信息页面。</span></p><p><span>4、</span><span>点击下载企业二维码，下载不带代理人员编码的登录二维码。</span></p><p><span>5、点击产品配置，跳转此企业的产品配置页面。</span></p><p><span>6、点击内容配置页面，跳转此企业的内容配页面。</span></p><p><span>7、点击删除按钮，页面弹出弹窗确认是否删除。</span></p><p><span>8、页面分页加载，每页显示10条。</span></p>",y="style",z="baseStyle",A="627587b6038d43cca051c114ac41ad32",B="pageAlignment",C="center",D="fill",E="fillType",F="solid",G="color",H=0xFFEDF3FC,I="image",J="imageHorizontalAlignment",K="near",L="imageVerticalAlignment",M="imageRepeat",N="auto",O="favicon",P="sketchFactor",Q="0",R="colorStyle",S="appliedColor",T="fontName",U="Applied Font",V="borderWidth",W="adaptiveStyles",X="interactionMap",Y="diagram",Z="objects",ba="id",bb="41216fde83c548d8a7542a13ae60d941",bc="label",bd="friendlyType",be="动态面板",bf="dynamicPanel",bg="styleType",bh="visible",bi=true,bj="size",bk="width",bl=1654,bm="height",bn=56,bo="imageOverrides",bp="percentWidth",bq=1,br="scrollbars",bs="none",bt="fitToContent",bu="propagate",bv="diagrams",bw="2cd3c4b427ef4e629619b13deacec8a9",bx="State1",by="Axure:PanelDiagram",bz="679d10ed3b0d4dfbae6bf156a6be628b",bA="矩形",bB="parentDynamicPanel",bC="panelIndex",bD=0,bE="vectorShape",bF=1100,bG="47641f9a00ac465095d6b672bbdffef6",bH="generateCompound",bI="e999bd26985b4f59b53343c5b404e764",bJ